tables.table_schema:
CREATE TABLE property_listings (
    id INT PRIMARY KEY,
    price DECIMAL,
    location TEXT,
    size INT,
    features JSONB
);
CREATE TABLE market_analysis (
    id INT PRIMARY KEY,
    property_id INT,
    market_value DECIMAL,
    analysis_date DATE
);

CREATE TABLE MarketAnalysis ( 
    analysis_id INT PRIMARY KEY, 
    listing_id INT, 
    analysis_date DATE, 
    analysis_result VARCHAR(255) 
);

CREATE TABLE PropertyFeatures ( 
    feature_id INT PRIMARY KEY, 
    feature_name VARCHAR(255), 
    description TEXT 
);

CREATE TABLE PropertyFeatures (
  id INT PRIMARY KEY,
  property_id INT REFERENCES PropertyListings(id),
  feature_name VARCHAR(255)
);

CREATE TABLE Locations (
  id INT PRIMARY KEY,
  location_name VARCHAR(255),
  city VARCHAR(255),
  country VARCHAR(255)
);

CREATE TABLE PropertyPrices (
  id INT PRIMARY KEY,
  property_id INT REFERENCES PropertyListings(id),
  price DECIMAL
);

CREATE TABLE PropertySizes (
  id INT PRIMARY KEY,
  property_id INT REFERENCES PropertyListings(id),
  size INT
);
